#include <iostream>
#include <map>

using namespace std;

template <typename T>
class Set {

public:

	struct Node {
		T value{};
		Node* left = nullptr;
		Node* right = nullptr;
		Node* parent = nullptr;
	};

	Set() : size(0), root(nullptr) {}

	Set(const Set& other) : size(other.size), root(Copy(other.root, nullptr)) {}

	Set(Set&& other) : size(other.size), root(other.root) {
		other.size = 0;
		other.root = nullptr;
	}

	Set& operator=(const Set& other) {
		if (this != &other) {
			Clear();
			size = other.size;
			root = Copy(other.root, nullptr);
		}
		return *this;
	}

	Set& operator=(Set&& other) {
		if (this != &other) {
			Clear();
			size = other.size;
			root = other.root;
			other.root = nullptr;
			other.size = 0;
		}
		return *this;
	}

	void Insert(const T& val) {
		if (root == nullptr) {
			root = new Node{ val, nullptr, nullptr, nullptr };
			size++;
			return;
		}
		Node* parent = nullptr;
		Node* node = root;
		while (node != nullptr && node->value != val) {
			parent = node;
			node = node->value > val ? node->left : node->right;
		}
		if (node == nullptr) {
			Node* temp = new Node{ val, nullptr, nullptr, parent };

			parent->value > val ? parent->left = temp : parent->right = temp;
			size++;
		}
	}

	void Erase(const T& val) {
		Node* parent = nullptr;
		Node* node = root;
		while (node != nullptr && node->value != val) {
			parent = node;
			node = node->value > val ? node->left : node->right;
		}
		if (node != nullptr) {
			if (node->left == nullptr && node->right == nullptr) {
				if (node == root) {
					root = nullptr;
				}
				else {
					node == parent->right ? parent->right = nullptr : parent->left = nullptr;
				}
				delete node;
			}
			else if (node->left == nullptr) {
				node->right->parent = node->parent;
				if (node == root) {
					root = node->right;
				}
				else {
					node == parent->right ? parent->right = node->right : parent->left = node->right;
				}
				delete node;
			}
			else if (node->right == nullptr) {
				node->left->parent = node->parent;
				if (node == root) {
					root = node->left;
				}
				else {
					node == parent->right ? parent->right = node->left : parent->left = node->left;
				}
				delete node;
			}
			else {
				Node* temp = Min(node->right);
				if (temp->right) {
					temp->right->parent = temp->parent;
				}
				temp == temp->parent->right ? temp->parent->right = temp->right : temp->parent->left = temp->right;
				node->value = temp->value;
				delete temp;
			}
			size--;
		}
	}

	void Print() {
		Print(root);
		cout << endl;
	}

	void Print(Node* node) {
		if (node != nullptr) {
			Print(node->left);
			cout << node->value << " ";
			Print(node->right);
		}
	}

	void Clear() {
		Clear(root);
		root = nullptr;
		size = 0;
	}

	void Clear(Node* node) {
		if (node != nullptr) {
			Clear(node->left);
			Clear(node->right);
			delete node;
		}
	}

	int Size() {
		return size;
	}

	Node* Min(Node* node) {
		if (node != nullptr) {
			while (node->left != nullptr) {
				node = node->left;
			}
		}
		return node;
	}

	Node* Max(Node* node) {
		if (node != nullptr) {
			while (node->right != nullptr) {
				node = node->right;
			}
		}
		return node;
	}

	Node* Copy(Node* node, Node* parent) {
		if (node == nullptr) {
			return node;
		}
		Node* temp = new Node{ node->value, nullptr, nullptr, parent };
		temp->left =  Copy(node->left, temp);
		temp->right = Copy(node->right, temp);
		return temp;
	}

	bool Compare(Node* a, Node* b) {
		Node* left = Min(a);
		Node* right = Min(b);
		while (left != nullptr && right != nullptr) {
			if (left->value != right->value) {
				return false;
			}
			left = Next(left);
			right = Next(right);
		}
		if (left == nullptr && right != nullptr || right == nullptr && left != nullptr) {
			return false;
		}
		return true;
	}

	Node* Begin() {
		return Min(root);
	}

	Node* End() {
		return Max(root);
	}

	Node* Find(const T& val) {
		Node* node = root;
		while (node != nullptr && node->value != val) {
			node = node->value > val ? node->left : node->right;
		}
		return node;
	}

	int Count(const T& val) {
		return Find(val) == nullptr ? 0 : 1;
	}

	Node* Next(Node* node) {
		if (node) {
			if (node->right) {
				return Min(node->right);
			}
			Node* parent = node->parent;
			while (parent != nullptr && parent->value < node->value) {
				parent = parent->parent;
			}
			return parent;
		}
	}

	Node* Prev(Node* node) {
		if (node) {
			if (node->left) {
				return Max(node->right);
			}
			Node* parent = node->parent;
			while (parent != nullptr && parent->value > node->value) {
				parent = parent->parent;
			}
			return parent;
		}
	}

	bool operator==(const Set& other) {
		if (size != other.size) {
			return false;
		}
		return Compare(root, other.root);
	}

	bool operator!=(const Set& other) {
		return !(*this == other);
	}

	~Set() {
		Clear();
	}


private:
	int size = 0;
	Node* root = nullptr;
};


void main() {
	Set<int> tr;
	srand(time(NULL));
	int arr[]{ 45, 30, 50, 27, 39, 90, 30, 15, 70, 93 };
	for (int i = 0; i < 10; i++) {
		//int val = rand() % 100;
		int val = arr[i];
		cout << val << " ";
		tr.Insert(val);
	}
	cout << endl << endl;

	cout << "_1_" << endl;
	tr.Print();

	cout << "_2_" << endl;
	tr.Erase(30);
	tr.Print();

	cout << "_3_" << endl;
	Set<int> tr2;
	tr2 = move(tr);
	tr2.Print();

	cout << "_4_" << endl;
	tr2.Insert(33);
	tr2.Print();

	cout << "_5_" << endl;
	tr2.Insert(41);
	tr2.Insert(42);
	tr2.Print();

	cout << "_6_" << endl;
	tr2.Erase(33);
	tr2.Print();

	cout << "_7_" << endl;
	tr2.Insert(40);
	tr2.Insert(47);
	tr2.Print();

	cout << "_8_" << endl;
	tr2.Erase(15);
	tr2.Print();

	cout << "_9_" << endl;
	tr2.Erase(45);
	tr2.Print();

	cout << "_10_" << endl;
	tr2.Erase(93);
	tr2.Print();

	cout << "_11_" << endl;
	tr.Print();
	tr.Clear();
	cout << "clear" << endl;
	tr.Print();

	cout << "_12_" << endl;
	auto a = tr2.Find(50);
	cout << a->value << endl;
	cout << tr2.Count(50) << endl;
	cout << tr2.Count(16) << endl;

	cout << "_13_" << endl;
	Set<int> tr3 = tr2;
	tr3.Insert(35);
	tr3.Print();
	cout << boolalpha;
	cout << (tr2 == tr3) << endl;
	cout << (tr2 != tr3) << endl;
}

#include <iostream>
#include <vector>
#include <map>
#include <ctime>
#include <iomanip>

class Wallet {
private:
    std::string name;
    double balance;

public:
    Wallet(const std::string& name, double balance)
        : name(name), balance(balance) {}

    std::string getName() const {
        return name;
    }

    double getBalance() const {
        return balance;
    }

    void deposit(double amount) {
        balance += amount;
        std::cout << "Deposited " << amount << " to " << name << std::endl;
    }

    void withdraw(double amount) {
        if (balance >= amount) {
            balance -= amount;
            std::cout << "Withdrawn " << amount << " from " << name << std::endl;
        } else {
            std::cout << "Insufficient balance in " << name << std::endl;
        }
    }
};

class Expense {
private:
    std::string category;
    double amount;
    time_t timestamp;

public:
    Expense(const std::string& category, double amount)
        : category(category), amount(amount) {
        timestamp = std::time(nullptr);
    }

    std::string getCategory() const {
        return category;
    }

    double getAmount() const {
        return amount;
    }

    time_t getTimestamp() const {
        return timestamp;
    }
};

class FinancialManager {
private:
    std::vector<Wallet> wallets;
    std::vector<Expense> expenses;

public:
    void addWallet(const std::string& name, double balance) {
        Wallet wallet(name, balance);
        wallets.push_back(wallet);
        std::cout << "Wallet created: " << name << std::endl;
    }

    Wallet* findWallet(const std::string& name) {
        for (auto& wallet : wallets) {
            if (wallet.getName() == name) {
                return &wallet;
            }
        }
        return nullptr;
    }

    void depositToWallet(const std::string& walletName, double amount) {
        Wallet* wallet = findWallet(walletName);
        if (wallet) {
            wallet->deposit(amount);
        } else {
            std::cout << "Wallet not found: " << walletName << std::endl;
        }
    }

    void withdrawFromWallet(const std::string& walletName, double amount) {
        Wallet* wallet = findWallet(walletName);
        if (wallet) {
            wallet->withdraw(amount);
        } else {
            std::cout << "Wallet not found: " << walletName << std::endl;
        }
    }

    void addExpense(const std::string& category, double amount) {
        Expense expense(category, amount);
        expenses.push_back(expense);
        std::cout << "Expense added: " << category << ", " << amount << std::endl;
    }

    std::map<std::string, double> calculateCategoryTotalExpenses(time_t start, time_t end) {
        std::map<std::string, double> categoryTotals;
        for (const auto& expense : expenses) {
            if (expense.getTimestamp() >= start && expense.getTimestamp() <= end) {
                categoryTotals[expense.getCategory()] += expense.getAmount();
            }
        }
        return categoryTotals;
    }

    void printReport(time_t start, time_t end) {
        std::cout << "Report from " << std::put_time(std::localtime(&start), "%Y-%m-%d") << " to "
                  << std::put_time(std::localtime(&end), "%Y-%m-%d") << std::endl;

        std::map<std::string, double> categoryTotals = calculateCategoryTotalExpenses(start, end);
        for (const auto& categoryTotal : categoryTotals) {
            std::cout << "Category: " << categoryTotal.first << ", Total Expenses: " << categoryTotal.second << std::endl;
        }
    }
};

int main() {
    FinancialManager manager;

    manager.addWallet("Wallet 1", 1000.0);
    manager.addWallet("Wallet 2", 2000.0);

    manager.depositToWallet("Wallet 1", 500.0);
    manager.withdrawFromWallet("Wallet 2", 100.0);

    manager.addExpense("Food", 50.0);
    manager.addExpense("Transportation", 30.0);
    manager.addExpense("Food", 20.0);

    time_t start = std::time(nullptr) - 86400; // 24 hours ago
    time_t end = std::time(nullptr);

    manager.printReport(start, end);

    return 0;
}

#include <iostream>
#include <string>
#include <vector>
#include <filesystem>

namespace fs = std::filesystem;

class FileManager {
public:
    virtual void showDrives() const = 0;
    virtual void createFolder(const std::string& folderName) = 0;
    virtual void createFile(const std::string& fileName) = 0;
    virtual void deleteFolder(const std::string& folderName) = 0;
    virtual void deleteFile(const std::string& fileName) = 0;
    virtual void renameFolder(const std::string& oldName, const std::string& newName) = 0;
    virtual void renameFile(const std::string& oldName, const std::string& newName) = 0;
    virtual void copyFile(const std::string& sourceFile, const std::string& destinationFile) = 0;
    virtual void moveFile(const std::string& sourceFile, const std::string& destinationFile) = 0;
    virtual void calculateSize(const std::string& path) const = 0;
    virtual void searchFiles(const std::string& path, const std::string& mask) const = 0;
};

class SimpleFileManager : public FileManager {
public:

    void showDrives() const override {
        std::vector<std::string> drives;
        for (const auto& entry : fs::directory_iterator("/")) {
            if (fs::is_directory(entry)) {
                drives.push_back(entry.path().string());
            }
        }
        std::cout << "Available drives: ";
        for (const auto& drive : drives) {
            std::cout << drive << " ";
        }
        std::cout << std::endl;
    }

    void createFolder(const std::string& folderName) override {
        if (fs::create_directory(folderName)) {
            std::cout << "Folder created: " << folderName << std::endl;
        } else {
            std::cout << "Failed to create folder." << std::endl;
        }
    }

    void createFile(const std::string& fileName) override {
        std::ofstream file(fileName);
        if (file) {
            std::cout << "File created: " << fileName << std::endl;
            file.close();
        } else {
            std::cout << "Failed to create file." << std::endl;
        }
    }

    void deleteFolder(const std::string& folderName) override {
        if (fs::remove_all(folderName) > 0) {
            std::cout << "Folder deleted: " << folderName << std::endl;
        } else {
            std::cout << "Failed to delete folder." << std::endl;
        }
    }

    void deleteFile(const std::string& fileName) override {
        if (fs::remove(fileName)) {
            std::cout << "File deleted: " << fileName << std::endl;
        } else {
            std::cout << "Failed to delete file." << std::endl;
        }
    }

    void renameFolder(const std::string& oldName, const std::string& newName) override {
        if (fs::rename(oldName, newName)) {
            std::cout << "Folder renamed: " << oldName << " -> " << newName << std::endl;
        } else {
            std::cout << "Failed to rename folder." << std::endl;
        }
    }

    void renameFile(const std::string& oldName, const std::string& newName) override {
        if (fs::rename(oldName, newName)) {
            std::cout << "File renamed: " << oldName << " -> " << newName << std::endl;
        } else {
            std::cout << "Failed to rename file." << std::endl;
        }
    }

    void copyFile(const std::string& sourceFile, const std::string& destinationFile) override {
        if (fs::copy_file(sourceFile, destinationFile, fs::copy_options::overwrite_existing)) {
            std::cout << "File copied: " << sourceFile << " -> " << destinationFile << std::endl;
        } else {
            std::cout << "Failed to copy file." << std::endl;
        }
    }

    void moveFile(const std::string& sourceFile, const std::string& destinationFile) override {
        if (fs::rename(sourceFile, destinationFile)) {
            std::cout << "File moved: " << sourceFile << " -> " << destinationFile << std::endl;
        } else {
            std::cout << "Failed to move file." << std::endl;
        }
    }

    void calculateSize(const std::string& path) const override {
        uintmax_t size = fs::file_size(path);
        std::cout << "Size of " << path << ": " << size << " bytes" << std::endl;
    }

    void searchFiles(const std::string& path, const std::string& mask) const override {
        std::cout << "Files found in " << path << " with mask " << mask << ":" << std::endl;
        for (const auto& entry : fs::recursive_directory_iterator(path)) {
            if (fs::is_regular_file(entry) && entry.path().filename().string().find(mask) != std::string::npos) {
                std::cout << entry.path().string() << std::endl;
            }
        }
    }
};

int main() {
    SimpleFileManager fileManager;

    fileManager.showDrives();

    fileManager.createFolder("TestFolder");
    fileManager.createFile("TestFile.txt");

    fileManager.deleteFolder("TestFolder");
    fileManager.deleteFile("TestFile.txt");

    fileManager.createFile("SourceFile.txt");
    fileManager.copyFile("SourceFile.txt", "DestinationFile.txt");

    fileManager.calculateSize("SourceFile.txt");
    fileManager.calculateSize("DestinationFile.txt");

    fileManager.renameFile("DestinationFile.txt", "RenamedFile.txt");

    fileManager.searchFiles(".", ".txt");

    return 0;
}

@subscriptions_api.route("/<string:subscription_id>/logs")
class SubscriptionsLogs(Resource):
    """Shows a list of all logs according to the role of the user"""

    @subscriptions_api.doc("Retrieve list of logs")
    @subscriptions_api.expect(parsers.logs_list_req_parser, validate=True)
    @subscriptions_api.marshal_with(SubscriptionModel.subscription_log_list_model)
    @authorize_employee
    def get(self, subscription_id: str):
        """Retrieve the single subscription"""
        parse_args, company_id = parsers.subscriptions_list_req_parser.parse_args(), request.employee.company_id

        subscription = get_subscription_or_404(company_id=company_id, subscription_id=subscription_id)

        if request.employee.role != UserRolesEnum.ADMIN and subscription.get("owner") != request.employee.email:
            return subscriptions_api.abort(message="Subscription not found", code=HTTPStatus.BAD_REQUEST)

        logs = paginate_through_all_subscription_logs(
            subscription_id, request.employee.role, parse_args.get("per_page"), parse_args.get("cursor")
        )
        log_items = [extend_subscription_log(log=log, company_id=company_id) for log in logs["Items"]]

        return {"logs": log_items, "pagination": logs.get("NextToken", "")}, HTTPStatus.OK

function easterCompetition(input) {
    let index = 0;
    let easterBread = Number(input[index]);
    index++
    let command = input[index];
    index++
    let points = 0
    let localPoints = 0;
    let counter = 0;
    let bestChef = '';
    let bestScore = 0;

    for (let i = 0; i < easterBread; i++) {
        counter++
        points = 0;
        let chef = command
        command = input[index];
        index++;


        while (command !== 'Stop') {
            localPoints = Number(command);
            points += localPoints

            command = input[index];
            index++
        }
        // След получаване на командата "Stop" се печата един ред:
        // "{името на пекаря} has {общият брой получени точки} points."
        console.log(`${chef} has ${points} points.`);

        // if (points >= bestScore) {
        //Ако след командата "Stop", пекарят е с най-много точки до момента, да се отпечата допълнителен ред:
        //"{името на пекаря} is the new number 1!"
        if (points > bestScore) {
            bestScore = points;
            bestChef = chef
            console.log(`${chef} is the new number 1!`);
        }
        // if (counter === 1) {
        //     console.log(`${chef} has ${points} points.`);
        // } else {
        //     console.log(`${chef} has ${points} points.`)
        // }
        command = input[index];
        index++;
    }

    console.log(`${bestChef} won competition with ${bestScore} points!`);
}
