using System;

abstract class Bank
{
    public void credit()
    {
        Console.WriteLine("You bank account is credited");
    }
    public void Debit()
    {
        Console.WriteLine("Your account us debited");
    }
}

class HDFC: Bank
{
    public void HDFCBankObject()
    {
        Console.WriteLine("This is the function of HDFC Bank class");
    }
}

class Program
{
    public static void Main()
    {
        HDFC hdFC = new HDFC();
        hdFC.credit();
        hdFC.Debit();
        hdFC.HDFCBankObject();

        Console.ReadLine();
    }
}

import re
