            $WCFMmp->template->get_template( 'sold-by/wcfmmp-view-sold-by-simple.php', array( 'product_id' => $product_id, 'vendor_id' => $store_id ) );
        }
    }
}, 50 );

/* To design a training database for a grocery warehouse, we can create the following tables: `Suppliers`, `Customers`, `Products`, `Warehouse`, `Stores`, and `Movement`.

Heres an example of how the tables could be structured: */

/* 1. `Suppliers` table: */

CREATE TABLE Suppliers (
  supplier_id INT PRIMARY KEY,
  supplier_name VARCHAR(100),
  supplier_address VARCHAR(100),
  supplier_phone VARCHAR(20)
);


/* 2. Customers table: */

CREATE TABLE Customers (
  customer_id INT PRIMARY KEY,
  customer_name VARCHAR(100),
  customer_address VARCHAR(100),
  customer_phone VARCHAR(20)
);


/* 3. `Products` table: */

CREATE TABLE Products (
  product_id INT PRIMARY KEY,
  product_name VARCHAR(100),
  supplier_id INT,
  FOREIGN KEY (supplier_id) REFERENCES Suppliers(supplier_id),
  expiry_date DATE
);


/* 4. `Warehouse` table: */

CREATE TABLE Warehouse (
  product_id INT,
  quantity INT,
  FOREIGN KEY (product_id) REFERENCES Products(product_id)
);


/* 5. `Stores` table: */

CREATE TABLE Stores (
  store_id INT PRIMARY KEY,
  store_name VARCHAR(100),
  store_address VARCHAR(100),
  store_phone VARCHAR(20)
);


/* 6. `Movement` table: */

CREATE TABLE Movement (
  movement_id INT PRIMARY KEY,
  product_id INT,
  store_id INT,
  quantity INT,
  movement_date DATE,
  FOREIGN KEY (product_id) REFERENCES Products(product_id),
  FOREIGN KEY (store_id) REFERENCES Stores(store_id)
);


/* Now, let's populate the tables with some example data: */


