/* Now, let's run the requested queries: */

/* 1. Determine the total amount of surplus and shortage in the grocery warehouse. */

SELECT SUM(quantity) AS total_surplus_shortage
FROM Warehouse;


/* 2. Find the name of the goods "Jubilee cookies" and the address of the company that supplied the goods. */

SELECT P.product_name, S.supplier_address
FROM Products P
JOIN Suppliers S ON P.supplier_id = S.supplier_id
WHERE P.product_name = 'Jubilee cookies';


/* 3. Remove the entry for the commodity "Inspiration" coffee. */

DELETE FROM Products
WHERE product_name = 'Inspiration coffee';

/* 4. Create a query that contains information about companies that raised the price of a product by more than $50 in the last year. */

-- Assuming there's a price column in the Products table
SELECT S.supplier_name, P.product_name
FROM Products P
JOIN Suppliers S ON P.supplier_id = S.supplier_id
WHERE P.price - (SELECT price FROM Products WHERE product_id = P.product_id AND YEAR(expiry_date) = YEAR(CURRENT_DATE()) - 1) > 50;

/* 5. Determine a list of items that expire in December 2005. */

SELECT product_name
FROM Products
WHERE YEAR(expiry_date) = 2005 AND MONTH(expiry_date) = 12;


